import XCTest

class Test_LongestSubstring: XCTestCase {

    func test() {
        let algorithm = LongestSubstringWithoutRepeats()
        
        var result  = 0
        var expected = 0
        var input : String
        
        input = ""
        result = algorithm.lengthOfLongestSubstring(input)
        expected = 0
        XCTAssertEqual(result, expected)
        
        input = "a"
        result = algorithm.lengthOfLongestSubstring(input)
        expected = 1
        XCTAssertEqual(result, expected)

        input = "aa"
        result = algorithm.lengthOfLongestSubstring(input)
        expected = 1
        XCTAssertEqual(result, expected)

        input = "abcd"
        result = algorithm.lengthOfLongestSubstring(input)
        expected = 4
        XCTAssertEqual(result, expected)
        
        input = "abcabcbb"
        result = algorithm.lengthOfLongestSubstring(input)
        expected = 3
        XCTAssertEqual(result, expected)

        input = "bbbbb"
        result = algorithm.lengthOfLongestSubstring(input)
        expected = 1
        XCTAssertEqual(result, expected)

        input = "pwwkew"
        result = algorithm.lengthOfLongestSubstring(input)
        expected = 3
        XCTAssertEqual(result, expected)
    }
    
    func test_Large() {
        let algorithm = LongestSubstringWithoutRepeats()
        
        var result  = 0
        var expected = 0
        var input : String
        input  = ""
        result = algorithm.lengthOfLongestSubstring(input)
        expected = 55
        XCTAssertEqual(result, expected)
    }
    
